      if not pictureData:
       error={'msg':'picture id does not exist','status':'404'}
       return JsonResponse(error,status=404)
      else:
       return JsonResponse({'picture':{'pictureId':pictureData[0], 'pictureData':pictureData[1], 'word':pictureData[2]}})
